import React from "react";

const Оглавление =()=>{
  return (
    <div className="Оглавление">
      <p>## Структура</p>
      <div className="Структура">
        <p>
          0. #порождающие-паттерны
        </p>
        <span>
          ## Порождающие паттерны
          Порождающие паттерны - это шаблоны, которые описывают создание обьектов.
        </span>
      </div>
    </div>
  );
}

export default Оглавление;
